import styled from "styled-components";
import { Link } from "react-router-dom";
import { Amazon_Logo } from "../../assets/Images";
import LocationOnOutlinedIcon from "@mui/icons-material/LocationOnOutlined";
import TopNavSearch from "./TopNavSearch";

const TopNav = () => {
  return (
    <TopNavContainer className="flex">
      {/* Top Nav Left Side */}
      <TopNavLeft className="flex top-nav-child">
        {/* Top Nav Logo */}
        <div className="nav__logo nav--hover ">
          <Link to={"/"} className="flex">
            <img src={Amazon_Logo} alt="Amazon Logo" /> <span>.in</span>
          </Link>
        </div>
        {/* Top Nav Logo */}
        {/* Top Nav Address */}
        <div className="nav__address nav--hover">
          <Link to={"/"} className="flex-column">
            <span className="nav__address__first">Hello</span>
            <span className="nav__address__second">
              <LocationOnOutlinedIcon />
              Select your address
            </span>
          </Link>
        </div>
        {/* Top  Nav Address */}
      </TopNavLeft>
      {/* Top Nav Left Side */}
      {/* Top Nav Middle */}
      <TopNavMiddle className="top-nav-child">
        {/* Top Nav Middle Search Bar */}
        <TopNavSearch />
      </TopNavMiddle>
      {/* Top Nav Middle */}
      <TopNavRight className="top-nav-child">hello</TopNavRight>
    </TopNavContainer>
  );
};

export default TopNav;

const TopNavContainer = styled.nav`
  align-items: center;
  background-color: rgb(14, 12, 41);
  padding: 0.4rem 0.8rem;
  width: 100%;
  .top-nav-child {
    flex: 0 1 0;
  }
`;
const TopNavLeft = styled.div`
  align-items: center;
  /* NavLogo */
  .nav__logo {
    padding: 0.7rem 0.4rem 0.2rem;
    img {
      width: 6.5rem;
      height: 2rem;
    }
    span {
      margin: 0.2rem 0 0.2rem 0;
      font-size: 0.95rem;
    }
  }
  /* Nav Address */
  .nav__address {
    justify-content: center;
    .nav__address__first {
      margin-left: 1.5rem;
      font-size: 0.75rem;
      color: #cecaca;
    }
    .nav__address__second {
      margin-top: -10px;
      font-size: 0.9rem;
      font-weight: 600;
      letter-spacing: 0.5px;
    }
  }
`;
const TopNavMiddle = styled.div``;
const TopNavRight = styled.div``;
